import React from 'react'

function Footer() {
  return (
    <div className='main-footer'>
      <div className='container'>
        <p className='footer_tag'><a class="navbar-brand" href="/">
              <img src="../../images/logo.png" alt="" /> SHIPSHAPE</a> 
              the largest database of marine professionals in the US</p>
      </div>
    </div>
  )
}

export default Footer
